import numpy as np

# The tests can be run by navigating to the tests folder and executing:
#   python -m unittest discover

def ReLU_activate(x):                                          # ReLu: cuts off the negative values and set them to 0
    return x.clip(min = 0)              

def Leaky_ReLU_activate(x):
    return np.where(x > 0, x, x * 0.01)                     # Leaky RelU: 0.01 times all negative values

def Sigmoid_activate(x):
    return 1/(1+np.exp(-x))                                 # Sigmoid: limit ouput between 0 and 1, useful for binary decisions

def Softmax_activate(x):
    m = np.exp(x)
    return m/m.sum(len(x.shape)-1)                          # Softmax: similar to sigmoid but useful for multi ouptut decisions (probability of 1 between all output) in output layer 


class Layer:

    def __init__(self, M, B, F):    
        self.matrix = np.array(M)                           #  copy the arrays
        self.bias = np.array(B)
        self.function = F

        if (len(self.matrix) != len(self.bias)):            # unittest: assert error if the length of the weights matrix and biases are not compatible
            raise ValueError

    def getMatrix(self):
        return self.matrix                                  
        
    def getBiasVector(self):
        return self.bias

    def getFunction(self):
        return self.function

    def forward(self, input):
        
        if (self.function == "Leaky_ReLU"):                 # apply matrix calculation, add biases and implement activation function between layers 
            output = np.matmul(self.matrix, input)  
            output = output + self.bias
            output = np.where(output > 0, output, output * 0.01)    # numpy condition, if the output is less then 0, it will time the output by 0.01 to reduce magnitude
            return output           

        elif (self.function == "Softmax"):                  # apply output layer calculation
            output =  np.matmul(self.matrix, input) 
            output = (output + self.bias).reshape(-1)       # reshape the array back into a shape of (1, 27) to prepare for softmax implementation
            m = np.exp(output)                              # take exponetial of the output, this may display warning msg on terminal about the size of the output being too large, but calculation still take place
            output = m/m.sum(len(output.shape)-1)           # obtain the multinominal probability distribution
            return output
            
        elif(self.function == np.sqrt):
            output = np.matmul(self.matrix, input)      
            output = output + self.bias
            output = np.sqrt(output)
            return output
        
        else:
            output = self.matrix.dot(input) + self.bias
            #output = (np.mat(self.matrix) * np.mat(input)) + self.bias
            return output
            


